import React from 'react';

function EnlistedBotCard({ bot, releaseBot, dischargeBot }) {
  const handleReleaseClick = () => {
    releaseBot(bot.id);
  };

  const handleDischargeClick = () => {
    dischargeBot(bot.id);
  };

  return (
    <div className="enlisted-bot-card">
      <h3>{bot.name}</h3>
      <img src={bot.avatar_url} alt={bot.name} />
      <p>Health: {bot.health}</p>
      <p>Damage: {bot.damage}</p>
      <p>Armor: {bot.armor}</p>
      <button onClick={handleReleaseClick}>Release</button>
      <button onClick={handleDischargeClick} className="red-button">Discharge</button>
    </div>
  );
}

export default EnlistedBotCard;
